import React, { useState } from 'react';
import './nav.css';
import { keywords } from './seo';

// Sample keywords for autocompletion
// const keywords = ["apple", "banana", "cherry", "date", "fig", "grape", "kiwi", "lemon", "mango", "orange"];

function Nav() {
  const [isAutocomActive, setIsAutocomActive] = useState(false);
  const [allList, setAllList] = useState([]);
  const [searchValue, setSearchValue] = useState('');

  const handleInputFocus = () => {
    setIsAutocomActive(true);
  };

  const handleInputBlur = () => {
    setIsAutocomActive(false);
  };

  const handleSearchInputChange = (e) => {
    const value = e.target.value;
    setSearchValue(value);

    // Filter and update the suggestion list
    const userSearch = value.toLowerCase();
    const filteredSuggestions = keywords.filter((data) =>
      data.toLowerCase().startsWith(userSearch)
    );

    setAllList(filteredSuggestions);
  };

  const handleListItemClick = (selectedUserData) => {
    setSearchValue(selectedUserData);
    setIsAutocomActive(false);
  };

  return (
    <nav className="navbar navbar-expand-lg navbar-dark bg-dark">
      <a className="navbar-brand" href="#" id="brand">
        <img
          src="logo192.png"
          style={{ height: "30px", width: "30px" }}
          alt="React"
        />{" "}
        React
      </a>
      <button
        className="navbar-toggler"
        type="button"
        data-bs-toggle="collapse"
        data-bs-target="#navbarNav"
        aria-controls="navbarNav"
        aria-expanded="false"
        aria-label="Toggle navigation"
      >
        <span className="navbar-toggler-icon"></span>
      </button>
      <div className="collapse navbar-collapse" id="navbarNav">
        <ul className="navbar-nav">
          <li className="nav-item">
            <a
              className="nav-link active"
              id="active"
              aria-current="page"
              href="#"
            >
              Home
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">
              About
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">
              Contact
            </a>
          </li>
          <li className="nav-item">
            <a className="nav-link" href="#">
              More
            </a>
          </li>
        </ul>
      </div>
      <div className="search-wrapper" id="search-wrapper">
        <div className="input-group search-field">
          <input
            type="search"
            className="form-control form-control-sm"
            id="search"
            placeholder="Search any product you want!"
            value={searchValue}
            onChange={handleSearchInputChange}
            onFocus={handleInputFocus}
            onBlur={handleInputBlur}
          />
          <div className="auto-com" id="autocom">
            {isAutocomActive && allList.length > 0 && (
              <ul>
                {allList.map((item, index) => (
                  <li
                    key={index}
                    onClick={() => handleListItemClick(item)}
                  >
                    {item}
                  </li>
                ))}
              </ul>
            )}
          </div>
        </div>
      </div>
      <button
        className="btn btn-outline-secondary bg-primary"
        type="button"
        style={{ color: "#333333" }}
        id="searchbtn"
      >
        Search
      </button>
      <div className="cta">
        <button className="btn btn-primary" id="login">
          Login
        </button>
        <button className="btn btn-success" id="signup">
          Sign Up
        </button>
      </div>
  </nav>
  );
}

export default Nav;
